// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract EtherSender {
    // Event to log Ether sent
    event Sent(address recipient, uint amount);

    // Function to receive Ether and increase the contract balance
    receive() external payable {}

    // Function to send Ether from the contract to a specific address
    function sendEther(address payable _recipient, uint _amount) public {
        require(address(this).balance >= _amount, "Insufficient contract balance");
        _recipient.transfer(_amount);

        emit Sent(_recipient, _amount);
    }

    // Function to check the contract balance
    function getBalance() public view returns (uint) {
        return address(this).balance;
    }
}

